const darkColor = "#262726"
const lightColor = "#eaeaea"
const accent = "#cba974";

const theme = {
    light: {
        bg: lightColor,
        elementColor: "#dcdcdc",
        color: darkColor,
        accent: accent,
    },
    dark: {
        bg: darkColor,
        elementColor: "#303130",
        color: accent,
        accent: accent,
    }
}

export default theme
